import React, { Component } from 'react';

class Bar extends Component {
    render() {
        return (
            <div className="bar">
                <div className="bar__diamond">
                    <i class="fa fa-diamond fa-3x"></i>
                </div>    
                <div className="bar__marker">
                    <i class="fa fa-map-marker fa-3x"></i>
                </div>
                <i class="fa fa-car fa-3x "></i>
                

            </div>
        );
    }
}

export default Bar;
